, conducting mechanic & Dealer meets to make the brand successful in the territory\\\\nResponsible for achieving the sales targets and making market credit under control for the distributors to show the healthy ROI.\\\\nEnsuring all payments regarding material deliver on shop and records are entered and updated correctly.\\\\nIncreasing the distribution, width, depth and appointing new channel Partners by identifying opportunities in the market.\\\\nProviding monthly scheme to Retailers to achieve their target and update their points in \\\",\\\"leavingReason\\\":null},{\\\"title\\\":\\\"Key Account Manager\\\",\\\"company\\\":\\\"Asian Granito Tiels\\\",\\\"from\\\":\\\"2014-06-23\\\",\\\"to\\\":\\\"2014-06-23\\\",\\\"description\\\":\\\"Building and maintaining relationships with builder, architect.\\\\nKey account wise mapping for all projects (planned and executed).\\\\nIdentifying & developing relations with the architects and construction companies linked with the key accounts for business development.\\\\nTo keep track on competitors movement in respective accounts.\\\\nGenerating revenue and grow client base, prospect, qualify, solidify relationships, overcome objections and close new accounts.\\\\nActing as a trusted adviser by consulting with key decision makers to understand their critical business issues and strategic objectives.\\\\nProviding monthly scheme to Dealers to achieve their quarterly and yearly TOD target.\\\"},{\\\"title\\\":\\\"Territory sales officer\\\",\\\"company\\\":\\\"Kansai Nerolac Paint\\\",\\\"from\\\":\\\"2013-10-23\\\",\\\"to\\\":\\\"2013-10-23\\\",\\\"description\\\":\\\"Provide customers and general contractors with a broad range of assistance in areas of product\\\\nknowledge, pricing and availability, special orders, upgrades, exchange, and promotional/competitive discounts.\\\\nMeeting contractors, Dealers and builders for project construction which is going on site.\\\\nEnsuring all payments regarding material deliver on site and records are entered and updated correctly.\\\\nBuild customer relationship by fulfilling their needs and earned a loyal client base via quick follow up.\\\\nProviding monthly scheme to Dealers, Contractors to achieve their target and update their points in system.\\\"},{\\\"title\\\":\\\"Team Leader\\\",\\\"company\\\":\\\"Asian paints\\\",\\\"from\\\":\\\"2006-12-23\\\",\\\"to\\\":\\\"2006-12-23\\\",\\\"description\\\":\\\"Handling with large team of SA & RA to drive sales forward.\\\\nMeeting Architects for project construction which is going on site.\\\\nMotivating the team to achieve high standards and APHS targets.\\\\nHandling new client enquiries and acting as the face of the business.\\\\nDealing with and resolving problems and issues which arise.\\\\nConduct training for sub coordinates as well as for painting contractor level.\\\\nBuild customer relationship by fulfilling their needs and earned a loyal client base via quick follow up.\\\\nMentoring and training up junior and new staff.\\\\nEnsuring all administrative and IT records are entered and updated correctly.\\\\nProviding prompt and accurate information on individual performance.\\\"}]\"', NULL, '2024-07-10 17:20:23', '2024-07-10 17:20:23'),
