 affected by covid-19 and was with Amazon SG (Feb 2020 to June 2020) as Pick & Pack eCommerce Associate.\\\\n\\\\nLeft in late March 2021 to rest hands (swollen nerves) from heavy duty restaurant captain work (wine glasses and cutleries) and to take up some full-day courses including social media marketing  and digital media marketing courses, refresher course in MS word.  \\\",\\\"leavingReason\\\":null},{\\\"title\\\":\\\"Personal Assistant to Executive Director and Leasing Manager (2 months covering staff on maternity leave)\\\",\\\"company\\\":\\\"Kranji Logistics Firm\\\",\\\"from\\\":\\\"2017-01-25\\\",\\\"to\\\":\\\"2017-01-25\\\",\\\"description\\\":\\\"Handling food factory leasing matters of tenants like Haidilao etc.  \\\\nAttending to carpark permits, making certain SOPs are met.\\\\nMonitored technicians\' and engineers\' work for timeliness and KPIs.\\\\nDrew up new contracts with regards to equipment licenses, maintenance of work and leasing contracts, pest control/extermination/garbage refusal data contracts.\\\\nDaily taking of minutes, acted as intermediary intepretor for executive director.\\\\nCollected lease monies, waiving of penalties where appropriate.\\\\nArranged and distributed alarm-testing memos.\\\\nSet up all meeting and travel appointments of director\\\\nDistributed mails to tenants door to door.\\\\nFeedback and monitored faulty lift and fotrklift issues.\\\\nAttended to government and NEA officials coming into areas to check on cleanliness.\\\\nBeing the point of contact for escalation of cctv and security equipment repairs.\\\\nRe-routed logistics and warehousing quotation enquiries to correct personnel.\\\\nAttend all other calls not covered by other departments.\\\\nAttended to occasional requests of sationary and lamination requests by CEO.\\\\n\\\\nLeft as this was only a temporary position.\\\",\\\"leavingReason\\\":null},{\\\"title\\\":\\\"Adhoc Frontline Remittance Officer\\\",\\\"company\\\":\\\"Western Union\\\",\\\"from\\\":\\\"2005-05-25\\\",\\\"to\\\":\\\"2005-05-25\\\",\\\"description\\\":\\\"2 to 3 days a week when shortage of staff.  Assisted customers to send money overseas.\\\\nExplained possible scams to customers before they decide if they still want to remit money overseas.\\\\n\\\\nLeft as two branches in Little India shut down one by one.  Western Union went through staff retrenchment for some of their permanent staff as well.\\\"},{\\\"title\\\":\\\"Senior Customer Service Executive cum.Tehnucal Hotline Support\\\",\\\"company\\\":\\\"Network for Electronic Transfers (S) Pte Ltd\\\",\\\"from\\\":\\\"1993-04-25\\\",\\\"to\\\":\\\"1993-04-25\\\",\\\"description\\\":\\\"Overall marketing and administrative support to Marketing Representatives and Marketing dept.\\\\nLoaded between customers and technicians.\\\\nRead charts to spot potential online and offline fraud and to inform all stakeholders where appropriate.\\\\nArranged training materials and training classes for customers\' cashiers.\\\\nAssisted marketing manager in presentation collaterals, marketing coupons and exhibitions.\\\\nProcessed new NETs applications, monitored application status while keeping customer informed of their application outcome.\\\\nProcessed and printed management reports, making adjustments for accuracy for the purpose of distribution of reports to all banks and to the GM.\\\\nCollating all cashiers\' card information for the purpose of embossing the cards after authorizing them with specialized machinery.\\\\nTrained new staff in the department for phone call etiquettes, etc.\\\\nWas also sole volunteer for coordinating staff-binding events (thrice a year) which included short weekend getaways, staff lucky draws and such.\\\\n\\\\nLeft to look after wheelbound-chair parent full-time (later part-time in Western Union as I hired a neighbour for some domestic help).  Brother was unwilling to contribute to cost of a domestic helper.\\\"},{\\\"title\\\":\\\"Clerical Assistant\\\",\\\"company\\\":\\\"The Housing and Development Board\\\",\\\"from\\\":\\\"1992-02-25\\\",\\\"to\\\":\\\"1992-02-25\\\",\\\"description\\\":\\\"Processed staff\'s Vehicle Loans application and repayment documentation, arranged for signatories, etc.\\\\nProcessed overtime claim forms (data entry of some 10,000 claims every month).\\\\nAssisted in the smooth transfer of accounts between branch offices to town councils (an ongoing project that lasted 2 to 4 months)..\\\\nRetrieval of microfiche for HR historical research.\\\\nSending out congratulatory letters to staff on their promotions or transfer of departments.\\\\nRetrieval of CPF printouts from another building that was the data centre for another colleague who had heart issues. \\\\nAny other adhoc duties as assigned.\\\\n\\\\nPassed two bar exams but never got recommended for promotion.  My salary rose from $380 to $495 (last pay when I left the HDB). \\\\nLeftt to join NETs.\\\"},{\\\"title\\\":\\\"Pick & Pack eCommerce Associate\\\",\\\"company\\\":\\\"Adecco (for Amazon SG)\\\",\\\"from\\\":\\\"2020-02-25\\\",\\\"to\\\":\\\"2020-02-25\\\",\\\"description\\\":\\\"Picking of all eCommerce orders including frozen foods.\\\\nStowing of items in their correct locations.\\\\nRecharged batteries of scanners.\\\\n\\\\nDid not re-sign contract with them as they did not investigate matter where I was mistaken to break social distancing rules on a day that was my off day.  I returned to Hong Ye group for food and beverage work.\\\"}]\"', NULL, '2024-07-10 17:20:24', '2024-07-10 17:20:24'),
