\\"to\\\":\\\"2014-12-01\\\",\\\"description\\\":\\\"Primary Job Functions\\\\n❧ To Support the Directors on managerial and operational aspects for all the stores as well as achieve the company’s Business Goals.\\\\n❧ Perform as a role model to all staff in work performance and other relevant scope of duties.  \\\\n❧ To ensure smooth operations for all outlets by overseeing their rosters, liaising with individual outlets managers to make sure targets are met.\\\\n❧ Liaising with external partners to make sure collaborations are run smoothly on the sales floor, and also loans of apparels to magazines or other publishers.\\\\n❧ To collate data pertaining to sales from all stores on a daily, weekly and monthly basis.\\\\n❧ To execute sales strategies and action plans implemented by the Directors or other personnel.\\\\n❧ Ensure that general costs and expenses are kept low.\\\\n❧ Staffing and recruitment.\\\\n❧ Oversee everything pertaining to operations across 2 brands.\\\\n \\\\n \\\\nOperations\\\\n✓ Ensure smooth operations for all the stores.\\\\n✓ To support in collating data for all reports pertaining to sales, customer service and logistics.\\\\n✓ Generate daily Sales Report and transactions\\\\n✓ Oversee the roster management of all stores.\\\\n✓ To provide information for stores pertaining to Sales, Sell-In and Sell thru\\\\n✓ Do interviews, managing recruitment and staffing issues.\\\\n \\\\nSales\\\\n✓ Ensure that monthly sales targets are achieved for all stores.\\\\n✓ To execute sales strategies and action plans implemented by Directors.\\\\n✓ Maintain a tight control on discounting and giveaways.\\\\n✓ Ensure that general costs and expenses are kept low.\\\\n✓ Ensure all monies are banked as per operations procedure.\\\\n✓ Monitors sales through the cash register; resolves discrepancies.\\\\n \\\\nCustomer Service\\\\n✓ Provide exemplary customer services ensuring high standards of performance in service excellence.\\\\n✓ Ensure customers’ complaints are handled tactfully in a professional manner with proper follow -up.\\\\n✓ Support the After Sales Services functions.\\\\n \\\\nStock / Inventory\\\\n✓ Support and responsible for the stock holding and shrinkages in Stores\\\\n✓ Conduct seasonal stock take for all stores.\\\\n✓ Qualitative security measures to ensure in preventing theft.\\\\n✓ Resolve discrepancies and report all findings to HQ..\\\\n✓ Perform regular review on merchandising pertaining to best seller and worst seller.\\\\n \\\\nPersonal Development / Qualities\\\\n✓ Maintain at all times competent product knowledge thru regular training with staff.  \\\\n✓ Adapt quality leadership skills to lead the staff to perform to their fullest potential.\\\\n✓ Perform effective communication skills and team spirit between retail staff and management.\\\\n✓ Build and maintain good rapport with staff and customers.\\\\n \\\\nHousekeeping\\\\n✓ Ensure proper care for stocks, fixtures and furniture within the store.\\\\n✓ Monitor and ensure visual displays and merchandising to be in accordance with Visual Merchandising Guidelines.\\\\n \\\\nLeadership\\\\n✓ Monitoring staff performance on a regular basis and identify areas for training when necessary.  \\\\n✓ Allocates and schedules work within the floor area, ensuring that all floor requirements are covered during operating hours; fills in for staff as required during breaks and other absences.\\\\n✓ Review and improvise staff morale leading to positive and dynamic working attitude and environment\\\\n \\\\nReason for Leaving:​Company change of direction, focusing on ecommerce instead of retail stores.\\\\nLast Drawn Salary: ​$2730 + $50mobile allowance + commission/incentives\\\\n \\\\n*Dec 08 – Dec 09*\\\\n• Due to bad economy and mum falling sick this period of time, so just did some part time jobs occasionally helping a friend at his restaurant, and also helping a friend with her recruitment agency, managing all administrative work and liaising with clients and candidates.\\\"},{\\\"title\\\":\\\"Store manager\\\",\\\"company\\\":\\\"Bodyworks pte ltd (Bods.bodynits)\\\",\\\"from\\\":\\\"2007-05-01\\\",\\\"to\\\":\\\"2008-10-01\\\",\\\"description\\\":\\\"Achievements\\\\n❧ Was promoted to Store Manager upon confirmation, at the end of 3 months probation by the GM.\\\\n❧ Managed to hit outlet target almost every month when the outlet previously didn’t even hit half the monthly target, for almost 2 years in the past.\\\\n❧ Managed to continue hitting sales target even though the management eventually increased the monthly target by 50%.\\\\n❧ Managed to cut operation costs to the minimum, while bringing an increase of 20% to outlet total annual sales.\\\\n \\\\nPrimary Job Functions\\\\n❧ To Support Operations Manager on managerial and operational aspects of the store as well as achieve the store’s Business Goals.\\\\n❧ Fulfill the role as a brand ambassador and portray at all times a professional and customer oriented image.\\\\n❧ Perform as a role model to all staff in work performance, customer service and other relevant scope of duties.\\\\n❧ Ensure smooth operations for all daily tasks of the store.\\\\n \\\\nReason for Leaving:​Company sizing down.\\\\nLast Drawn Salary: ​$1750 + $100incentive + commission\\\"},{\\\"title\\\":\\\"Senior sales associate\\\",\\\"company\\\":\\\"Orient Pacific Sunwear pte ltd \\\",\\\"from\\\":\\\"2006-02-01\\\",\\\"to\\\":\\\"2007-05-01\\\",\\\"description\\\":\\\"Job Functions\\\\n❧ Acting Shop Supervisor managing store operations.\\\\n❧ Support Operation Manager in setting up operational procedures, staff training, customer service & staff general welfare.\\\\n❧ Support general logistic functions and ensure housekeeping standards were maintained at all times\\\\n❧ Fulfill the role as an ambassador to portray at all times a professional and customer oriented image.\\\\n❧ Lead as a role model to all staff in work performance, customer service and other relevant scope of duties.  \\\\n \\\\nReason for leaving: Seeking better prospect and stability.\\\\nLast Drawn: $1300 basic + comm. + incentives\\\"},{\\\"title\\\":\\\"Fragrance Associate (2001 to 2006 – Part-time converted to Full-time after NS)\\\",\\\"company\\\":\\\"Luxasia pte ltd\\\",\\\"from\\\":\\\"2001-01-01\\\",\\\"to\\\":\\\"2006-01-01\\\",\\\"description\\\":\\\"Job Functions\\\\n- Closely monitor and ensure that monthly personal sales targets are achieved.\\\\n- To execute sales strategies and action plans implemented by Sales/Brand Manager.\\\\n- Provide exemplary customer services ensuring high standards of performance in service excellence.\\\\n- Ensure counter is kept neat and tidy at all times.\\\\n- Ensure proper care for stocks, fixtures and furniture within the counter.\\\\n- Monitor and ensure V/M to be in accordance with Visual Merchandising Guidelines.\\\\n- Monitoring the store inventory status, doing seasonal stocktake.\\\\n- Resolve discrepancies and report all findings to HQ.\\\\n- Monitors and coordinates receiving of merchandise and price tagging.\\\\n \\\\nPersonal Development / Qualities\\\\nMaintain at all times competent product knowledge thru regular attendance of product trainings.  \\\\nPerform effective communication skills and team spirit between colleagues and management.\\\\nBuild and maintain good rapport with internal/external staff and customers.\\\\n \\\\nReason for leaving: For better career advancement\\\\nLast Drawn: $900 basic + comm. + incentives\\\\n \\\\nSAF (Army Enlistment): Admin Assistant (2004 to 2005)\\\"}]\"', NULL, '2024-07-10 17:21:18', '2024-07-10 17:21:18'),
